@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'entrega';
}
<div id="layout">
  <header>
    <app-header></app-header>
  </header>
  <main class="main-container"></main>
  <app-hero></app-hero>

  <footer class="main-container">
    <app-footer></app-footer>
  </footer>
</div>
